package all

import (
	"github.com/bluenviron/gomavlib/v3/pkg/dialects/development"
)

// State of RAIM processing.
type GPS_RAIM_STATE = development.GPS_RAIM_STATE

const (
	// RAIM capability is unknown.
	GPS_RAIM_STATE_UNKNOWN GPS_RAIM_STATE = development.GPS_RAIM_STATE_UNKNOWN
	// RAIM is disabled.
	GPS_RAIM_STATE_DISABLED GPS_RAIM_STATE = development.GPS_RAIM_STATE_DISABLED
	// RAIM integrity check was successful.
	GPS_RAIM_STATE_OK GPS_RAIM_STATE = development.GPS_RAIM_STATE_OK
	// RAIM integrity check failed.
	GPS_RAIM_STATE_FAILED GPS_RAIM_STATE = development.GPS_RAIM_STATE_FAILED
)
